CREATE MEMORY TABLE CUSTOMERS(CUSTOMERID VARCHAR(255) NOT NULL PRIMARY KEY,PHONE VARCHAR(255),POSTALCODE VARCHAR(255),REGION VARCHAR(255),CONTACTNAME VARCHAR(255),ADDRESS VARCHAR(255),FAX VARCHAR(255),COMPANYNAME VARCHAR(255),COUNTRY VARCHAR(255),CITY VARCHAR(255),CONTACTTITLE VARCHAR(255));
CREATE MEMORY TABLE ORDER_DETAILS(QUANTITY SMALLINT,DISCOUNT REAL,UNITPRICE NUMERIC(38),ORDERID INTEGER NOT NULL,PRODUCTID INTEGER NOT NULL,PRIMARY KEY(ORDERID,PRODUCTID));
CREATE MEMORY TABLE PRODUCTS(PRODUCTID INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 0) NOT NULL PRIMARY KEY,UNITSINSTOCK SMALLINT,REORDERLEVEL SMALLINT,QUANTITYPERUNIT VARCHAR(255),PRODUCTNAME VARCHAR(255),UNITPRICE NUMERIC(38),DISCONTINUED SMALLINT,UNITSONORDER SMALLINT,CATEGORYID INTEGER,SUPPLIERID INTEGER);
CREATE MEMORY TABLE EMPLOYEES(EMPLOYEEID INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 0) NOT NULL PRIMARY KEY,LASTNAME VARCHAR(255),COUNTRY VARCHAR(255),PHOTO LONGVARBINARY,BIRTHDATE TIMESTAMP,PHOTOPATH VARCHAR(255),HOMEPHONE VARCHAR(255),TITLE VARCHAR(255),CITY VARCHAR(255),NOTES LONGVARCHAR,EXTENSION VARCHAR(255),TITLEOFCOURTESY VARCHAR(255),POSTALCODE VARCHAR(255),REGION VARCHAR(255),ADDRESS VARCHAR(255),HIREDATE TIMESTAMP,FIRSTNAME VARCHAR(255),REPORTSTO INTEGER);
CREATE MEMORY TABLE ORDERS(ORDERID INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 0) NOT NULL PRIMARY KEY,SHIPPOSTALCODE VARCHAR(255),SHIPPEDDATE TIMESTAMP,ORDERDATE TIMESTAMP,FREIGHT NUMERIC(38),SHIPREGION VARCHAR(255),REQUIREDDATE TIMESTAMP,SHIPCITY VARCHAR(255),SHIPCOUNTRY VARCHAR(255),EMPLOYEEID INTEGER,SHIPVIA INTEGER,CUSTOMERID VARCHAR(255),SHIPADDRESS VARCHAR(255),SHIPNAME VARCHAR(255));
CREATE MEMORY TABLE CATEGORIES(CATEGORYID INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 0) NOT NULL PRIMARY KEY,PICTURE LONGVARBINARY,DESCRIPTION LONGVARCHAR,CATEGORYNAME VARCHAR(255));
CREATE MEMORY TABLE SUPPLIERS(SUPPLIERID INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 0) NOT NULL PRIMARY KEY,PHONE VARCHAR(255),CONTACTNAME VARCHAR(255),FAX VARCHAR(255),COMPANYNAME VARCHAR(255),COUNTRY VARCHAR(255),CONTACTTITLE VARCHAR(255),CITY VARCHAR(255),REGION VARCHAR(255),POSTALCODE VARCHAR(255),ADDRESS VARCHAR(255),HOMEPAGE LONGVARCHAR);
