INSERT INTO EMPLOYEES VALUES(1,'Davolio','USA','','1948-12-08 00:00:00.000000000','http://accweb/emmployees/davolio.bmp','(206) 555-9857','Sales Representative','Seattle','Education includes a BA in psychology from Colorado State University in 1970.  She also completed The Art of the Cold Call.  Nancy is a member of Toastmasters International.','5467','Ms.','98122','WA','507 - 20th Ave. E.Apt. 2A','1992-05-01 00:00:00.000000000','Nancy',2);
INSERT INTO EMPLOYEES VALUES(2,'Fuller','USA','','1952-02-19 00:00:00.000000000','http://accweb/emmployees/fuller.bmp','(206) 555-9482','Vice President, Sales','Tacoma','Andrew received his BTS commercial in 1974 and a Ph.D. in international marketing from the University of Dallas in 1981.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 1992 and to vice president of sales in March 1993.  Andrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.','3457','Dr.','98401','WA','908 W. Capital Way','1992-08-14 00:00:00.000000000','Andrew',NULL);
INSERT INTO EMPLOYEES VALUES(3,'Leverling','USA','','1963-08-30 00:00:00.000000000','http://accweb/emmployees/leverling.bmp','(206) 555-3412','Sales Representative','Kirkland','Janet has a BS degree in chemistry from Boston College (1984).  She has also completed a certificate program in food retailing management.  Janet was hired as a sales associate in 1991 and promoted to sales representative in February 1992.','3355','Ms.','98033','WA','722 Moss Bay Blvd.','1992-04-01 00:00:00.000000000','Janet',2);
INSERT INTO EMPLOYEES VALUES(4,'Peacock','USA','','1937-09-19 00:00:00.000000000','http://accweb/emmployees/peacock.bmp','(206) 555-8122','Sales Representative','Redmond','Margaret holds a BA in English literature from Concordia College (1958) and an MA from the American Institute of Culinary Arts (1966).  She was assigned to the London office temporarily from July through November 1992.','5176','Mrs.','98052','WA','4110 Old Redmond Rd.','1993-05-03 00:00:00.000000000','Margaret',2);
INSERT INTO EMPLOYEES VALUES(5,'Buchana','UK','','1955-03-04 00:00:00.000000000','http://accweb/emmployees/buchanan.bmp','(71) 555-4848','Sales Manager','Londo','Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 1976.  Upon joining the company as a sales representative in 1992, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 1993.  Mr. Buchanan has completed the courses Successful Telemarketing and International Sales Management.  He is fluent in French.','3453','Mr.','SW1 8JR',NULL,'14 Garrett Hill','1993-10-17 00:00:00.000000000','Steve',2);
INSERT INTO EMPLOYEES VALUES(6,'Suyama','UK','','1963-07-02 00:00:00.000000000','http://accweb/emmployees/davolio.bmp','(71) 555-7773','Sales Representative','Londo','Michael is a graduate of Sussex University (MA, economics, 1983) and the University of California at Los Angeles (MBA, marketing, 1986).  He has also taken the courses Multi-Cultural Selling and Time Management for the Sales Professional.  He is fluent in Japanese and can read and write French, Portuguese, and Spanish.','428','Mr.','EC2 7JR',NULL,'Coventry HouseMiner Rd.','1993-10-17 00:00:00.000000000','Michael',5);
INSERT INTO EMPLOYEES VALUES(7,'King','UK','','1960-05-29 00:00:00.000000000','http://accweb/emmployees/davolio.bmp','(71) 555-5598','Sales Representative','Londo','Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1992, the year he joined the company.  After completing a course entitled Selling in Europe, he was transferred to the London office in March 1993.','465','Mr.','RG1 9SP',NULL,'Edgeham HollowWinchester Way','1994-01-02 00:00:00.000000000','Robert',5);
